import React, { useState, useEffect } from 'react';
import styles from '../Styles/Signin.module.css';
import { Link } from 'react-router-dom';
import Header from './Header';
import Footer from './Footer';

const images = ['image1', 'image2', 'image3', 'image4'];

function Signin() {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [currentImageIndex, setCurrentImageIndex] = useState(0);

    const handleUsernameChange = (event) => {
        setUsername(event.target.value);
    };

    const handlePasswordChange = (event) => {
        setPassword(event.target.value);
    };

    useEffect(() => {
        const timer = setInterval(() => {
            setCurrentImageIndex((prevIndex) => (prevIndex + 1) % images.length);
        }, 2000);

        return () => {
            clearInterval(timer);
        };
    }, []);

    return (
        <div>
            <Header></Header>
            <div className={`${styles.loginContainer} ${styles[images[currentImageIndex]]}`}>
                <img
                    src="https://im.dongseo.ac.kr/resources/images/img_m_txt.png"
                    alt="Dongseo"
                    className={styles.img}
                ></img>

                <div className={styles.loginForm}>
                    <h2 className={styles.title}>로그인</h2>

                    <div>
                        <label className={styles.log}>ID: </label>
                        <br></br>
                        <input
                            type="text"
                            placeholder="아이디"
                            value={username}
                            onChange={handleUsernameChange}
                        />
                    </div>

                    <div>
                        <label className={styles.log}>Password: </label>
                        <br></br>
                        <input
                            type="password"
                            placeholder="비밀번호"
                            value={password}
                            onChange={handlePasswordChange}
                        />
                    </div>

                    <div>
                        <Link to="/signup">
                            <button>
                                <strong>회원가입</strong>
                            </button>
                        </Link>
                        <button type="submit">
                            <strong>로그인</strong>
                        </button>
                    </div>

                    <div className={styles.vline}>
                        <div className={styles.contentContainer}>
                            <h2 className={styles.title}>공지사항</h2>
                        </div>
                        <div className={styles.scrollContainer}>
                            <p>
                                해당시스템에서는 상시 로그인가능하며 예비수강신청/수강신청 각
                                메뉴진입은 해당 신청 시작시간 30분 전부터 가능합니다. 로그인 후
                                일정시간 서비스 요청이 없으면 서버연결은 자동 종료 됩니다. 수강신청
                                종료 후 개인정보 보호를 위해 반드시 로그아웃 하시기 바랍니다. 크롬,
                                파이어폭스, 사파리 브라우저에 최적화 되있습니다. 인터넷 익스플로러
                                11 이하 버전을 사용하시는 분들은 정상적으로 동작하지 않을수 있으며,
                                11 버전이상으로 업그레이드 하시기를 권장합니다. 자세한 설명은 로그인
                                후 공지사항에서 확인하실 수 있습니다. 문의사항이 있으신 분들은 해당
                                학(부)과로 연락하시기 바랍니다. 반드시 팝업 차단을 해제하시기
                                바랍니다. [도구]->[팝업차단]->[팝업차단사용안함]
                            </p>
                        </div>
                    </div>
                </div>
            </div>
            <Footer></Footer>
        </div>
    );
}

export default Signin;
